import radium,{ StyleRoot } from 'radium';
import Banner from 'https://obcdn4.obdesign.com.tw/images/ObdesignBanner/WOMEN/images/190524-AB6701-1920x820_v1.jpg';

const style = {
    wrapper:{
        width: '100%',
    },
}

class App extends Component{
    render(){ 
        return (
    <StyleRoot style={style.wrapper}>
        <div>
            <img 
            src={Banner} 
            alt="banner" 
            style={styles.crossPic}/>
        </div>
    </StyleRoot>

        )
    }
}






export default radium(Banner);
